package myFirstjavaprogram;

public class forloopProgram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		 
		int f=0; int s=1;
		
		int t=f+s;
		
		for(int i=0; i<100; i++) {
			
			System.out.println(f);
			t=f+s;
			
			f=s;
			
			s=t;
			
			
		}
		
		
							
		}
			 
			
	

	
}